import React from "react";
// STYLES
import "../styles/Photos.scss";
import photo from "../stockPhotos/v1.48.JPG";

const Photos = () => {
  return (
    <div className='Photos-Component'>
      <div className='Photo-Image'>
        <h1 className='Page-Title'>PHOTOS</h1>
        <img src={photo} alt=''></img>
      </div>
    </div>
  );
};
export { Photos };
